@GiudGiud When using old version of MOOSE, we often declare he material property with the same name for different blocks, for example, "density", "thermal_conductivity" . It would not error  because the block is specified in the input file.
And it is convenient. When caring about the property "density", we just need to create an AuxVariable "density" in the input file instead of creating many AuxVariable "density1" "density2" "density3" "density4" "density5" for each block.
However, this new-added dependency checking function can not identify different blocks, so it may cause the cyclic dependency error report.
